from typing import *


def solution(heights: List[int]):
    length = len(heights)
    max_area = 0
    for i in range(length):
        left = i
        while left > 0 and heights[left - 1] >= heights[i]:
            """
            左边的高度 > 当前高度 可以左移动
            """
            left -= 1
        right = i
        while right < len(heights) - 1 and heights[right + 1] >= heights[i]:
            """
            右边高度
            """
            right += 1
        width = right - left + 1
        max_area = max(max_area, width * heights[i])
    return max_area

